import "./Modal.css"

import React, { Dispatch } from "react"

export interface IModalProps{
    modalActive:boolean,
    setModalActive:Dispatch<React.SetStateAction<boolean>>
}
export const Modal=({modalActive,setModalActive}:IModalProps)=>{
    return (
        <div className="modal" onClick={()=>setModalActive(false)}>
            <div className="modal__content">

            </div>
        </div>
    )
}
